import { alpha, styled } from '@mui/material/styles';
import InputBase from '@mui/material/InputBase';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';
import CardContent from '@mui/material/CardContent';
import Card from '@mui/material/Card';
import React, { useState, useEffect } from "react";
import axios from "axios";
import "./ProjectDetails.css";
import TextField from '@mui/material/TextField';
import Autocomplete, { createFilterOptions } from '@mui/material/Autocomplete';


export default function CustomizedInputsStyled() {

  const BootstrapInput = styled(InputBase)(({ theme }) => ({
    'label + &': {
      marginTop: theme.spacing(2.5),

    },
    '& .MuiInputBase-input': {
      borderRadius: 4,
      position: 'relative',
      border: '1px solid',
      borderColor: theme.palette.mode === 'light' ? '#B4B4B4' : '#B4B4B4',
      fontSize: '11px',
      width: '480px',
      padding: '10px 12px',
      transition: theme.transitions.create([
        'border-color',
        'background-color',
        'box-shadow',
      ]),
      fontFamily: [
        'Roboto',
      ].join(','),
      position: 'relative',
      fontStyle: 'normal',
      fontWeight: 500,
      // fontSize: 16,
      lineHeight: '16px',
    },
  }));


  const filterOptions = createFilterOptions({
    matchFrom: 'start',
    stringify: (option) => option.title,
  });

  const SelectCategoryOfTheProject = [
    { title: 'A' },
    { title: 'B' },
  ];

  return (
    <Card style={{
      width: 1100,
      height: 500,
      marginTop: 50,
      marginLeft: 50.
    }}>
      <CardContent>
        <Box
          component="form"
          noValidate
          sx={{
            display: 'grid',
            gridTemplateColumns: { sm: '1fr 1fr' },
            gap: 2,
            marginTop: '15px',

          }}
        >
          <FormControl variant="standard">
            <InputLabel shrink htmlFor="bootstrap-input" sx={{ color: '#518B9F', fontWeight: 'bold' }} >
              Title
            </InputLabel>
            <BootstrapInput defaultValue="Title of your project" id="bootstrap-input" />
          </FormControl>

          <FormControl variant="standard">
            <InputLabel shrink htmlFor="bootstrap-input" sx={{ color: '#518B9F', fontWeight: 'bold' }}>
              Category
            </InputLabel>
            <Autocomplete
              id="filter-demo"
              options={SelectCategoryOfTheProject}
              getOptionLabel={(option) => option.title}
              filterOptions={filterOptions}
              sx={{
                // borderRadius: 4,
                // position: 'relative',
                // fontSize: '11px',
                width: '500px',
                // padding: '10px 12px',
                // fontFamily: [
                //   'Roboto',
                // ]
              }}
              renderInput={(params) => <TextField {...params}
              // label="Select category of the project" 
              />}
            />
          </FormControl>

        </Box>
        <FormControl className='gggggggg' variant="standard" sx={{ marginTop: '15px' }}>
          <InputLabel shrink htmlFor="bootstrap-input" sx={{ color: '#518B9F', fontWeight: 'bold' }}>
            Project Scope
          </InputLabel>
          <TextField
          placeholder="Provide a detail description of your project"
          multiline
          rows={2}
          maxRows={4}
          sx={{ Width: '1100px' }}
        />
        </FormControl>
        
        <FormControl variant="standard" sx={{ marginTop: '15px' }}>
          <InputLabel shrink htmlFor="bootstrap-input" sx={{ color: '#518B9F', fontWeight: 'bold' }}>
            Requirements
          </InputLabel>
          <BootstrapInput defaultValue="Describe Requirement of Project" id="bootstrap-input" />
        </FormControl>
        
        <Box
          component="form"
          noValidate
          sx={{
            display: 'grid',
            gridTemplateColumns: { sm: '1fr 1fr' },
            gap: 2,
            marginTop: '15px',
          }}
        >
          <FormControl variant="standard">
            <InputLabel shrink htmlFor="bootstrap-input" sx={{ color: '#518B9F', fontWeight: 'bold' }}>
              Duration
            </InputLabel>
            <BootstrapInput defaultValue="Time required to finish the project" id="bootstrap-input" />
          </FormControl>

          <FormControl variant="standard">
            <InputLabel shrink htmlFor="bootstrap-input" sx={{ color: '#518B9F', fontWeight: 'bold' }}>
              Technology/Tools
            </InputLabel>
            <BootstrapInput defaultValue="Technology/ Tool need to be used in this project" id="bootstrap-input" />
          </FormControl>

        </Box>

        <Box
          component="form"
          noValidate
          sx={{
            display: 'grid',
            gridTemplateColumns: { sm: '1fr 1fr' },
            gap: 2,
            marginTop: '15px',
          }}
        >
          <FormControl variant="standard">
            <InputLabel shrink htmlFor="bootstrap-input" sx={{ color: '#518B9F', fontWeight: 'bold' }}>
              Deliverable
            </InputLabel>
            <BootstrapInput defaultValue="Describe deliverables" id="bootstrap-input" />
          </FormControl>

          <FormControl variant="standard">
            <InputLabel shrink htmlFor="bootstrap-input" sx={{ color: '#518B9F', fontWeight: 'bold' }}>
              Tags
            </InputLabel>
            <BootstrapInput defaultValue="Add relevant tags to help others find your project" id="bootstrap-input" />
          </FormControl>

        </Box>
      </CardContent>
    </Card>
  );
}
